import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import profilePic from "../Images/dp.jpg";
import Box from "@material-ui/core/Box";
import Avatar from "@material-ui/core/Avatar";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import EmailIcon from "@material-ui/icons/Email";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  container: {
    height: 350,
    backgroundColor: "#e1f5fe",
  },

  infoHolder: {
    display: "flex",
    height: 350,
    alignItems: "center",
    justifyContent: "center",
    float: "left",
    width: "50%",
  },

  imageHolder: {
    display: "flex",
    height: 350,
    alignItems: "center",
    justifyContent: "center",
    float: "right",
    width: "50%",
  },

  textHolder: {
    marginLeft: theme.spacing(20),
  },

  nameHolder: {
    maxWidth: "500",
    width: "100%",
  },

  name: {
    fontWeight: 400,
  },

  description: {
    marginTop: theme.spacing(2),
  },

  avatar: {
    width: theme.spacing(30),
    height: theme.spacing(30),
    marginRight: theme.spacing(20),
  },
}));

export default function Home() {
  const classes = useStyles();
  return (
    <div className={classes.container}>
      <Box className={classes.infoHolder}>
        <Box className={classes.textHolder}>
          <Chip label="Hi there, I'm" color="primary" />
          <Box className="nameHolder">
            <Typography variant="h3" className={classes.name}>
              Lim Zi Yang
            </Typography>
            <Typography variant="h5">Computer Science Student @ NUS</Typography>
          </Box>
          <Box className={classes.description}>
            <Typography variant="subtitle2">
              <EmailIcon />
              limziyang8@gmail.com
            </Typography>
          </Box>
        </Box>
      </Box>
      <Box className={classes.imageHolder}>
        <Avatar alt="Lim Zi Yang" src={profilePic} className={classes.avatar} />
      </Box>
    </div>
  );
}
